import React from "react";

const MyFarm = () => {

  // Local mock data representing fields - Replace with API data later
  const farmFields = [
    {
      id: "A",
      name: "Wheat Field - Zone A",
      status: "Healthy",
      healthScore: 85,
      issues: null,
      recommendations: [
        "Continue current watering schedule.",
        "Nitrogen fertilizer suggested next week."
      ]
    },
    {
      id: "B",
      name: "Rice Field - Zone B",
      status: "Needs Attention",
      healthScore: 62,
      issues: [
        "Leaf tip yellowing observed.",
        "Signs of nutrient deficiency detected."
      ],
      recommendations: [
        "Increase nitrogen mix slightly.",
        "Re-check water pH before irrigation."
      ]
    },
    {
      id: "C",
      name: "Cotton Field - Zone C",
      status: "Critical",
      healthScore: 35,
      issues: [
        "Heavy pest activity recorded.",
        "Possible bollworm damage."
      ],
      recommendations: [
        "Immediate pesticide support recommended.",
        "Remove heavily damaged crop sections."
      ]
    }
  ];

  return (
    <div className="p-6 bg-gray-100 min-h-screen font-sans">
      <div className="max-w-6xl mx-auto space-y-8">

        {/* Header */}
        <header className="flex justify-between items-center">
          <div>
            <h2 className="text-2xl font-bold text-gray-800">My Farm Dashboard</h2>
            <p className="text-gray-500 text-sm">Field-wise condition overview</p>
          </div>
          <button className="bg-white border px-4 py-2 rounded-lg text-sm hover:bg-gray-50 transition">
            Voice Assistance
          </button>
        </header>

        {/* Summary Board */}
        <section className="grid grid-cols-2 md:grid-cols-4 gap-4">
          {[
            { label: "Total Fields", value: 3 },
            { label: "Healthy", value: 1 },
            { label: "Needs Attention", value: 1 },
            { label: "Critical", value: 1 }
          ].map((item, index) => (
            <div
              key={index}
              className="bg-white p-5 rounded-xl shadow-sm border-l-4 border-green-500"
            >
              <p className="text-gray-400 text-[11px] font-semibold uppercase">{item.label}</p>
              <p className="text-2xl font-bold text-gray-800">{item.value}</p>
            </div>
          ))}
        </section>

        {/* Main Layout */}
        <main className="grid grid-cols-1 lg:grid-cols-3 gap-8">

          {/* Field Reports */}
          <div className="lg:col-span-2 space-y-6">
            <h3 className="text-lg font-semibold text-gray-700">Field Condition Reports</h3>

            {farmFields.map((field) => (
              <div key={field.id} className="bg-white p-6 shadow-sm border rounded-2xl">
                <div className="flex justify-between">
                  <div>
                    <h4 className="text-xl font-semibold text-gray-800">{field.name}</h4>
                    <p className="text-sm font-medium text-gray-600">Status: {field.status}</p>
                    <p className="text-sm font-medium text-gray-600">
                      Health Score: {field.healthScore}%
                    </p>
                  </div>
                </div>

                {/* Issues */}
                {field.issues && (
                  <div className="mt-4">
                    <h5 className="text-xs font-bold text-gray-500 uppercase mb-1">Issues Noted</h5>
                    <ul className="text-sm text-gray-700 space-y-1">
                      {field.issues.map((issue, i) => (
                        <li key={i}>- {issue}</li>
                      ))}
                    </ul>
                  </div>
                )}

                {/* Recommendations */}
                <div className="mt-4 bg-green-50 border border-green-100 p-4 rounded-xl">
                  <h5 className="text-xs font-bold text-green-800 uppercase mb-1">Suggested Actions</h5>
                  <ul className="text-sm text-green-700 space-y-1">
                    {field.recommendations.map((step, i) => (
                      <li key={i}>- {step}</li>
                    ))}
                  </ul>
                </div>

                <div className="text-[11px] text-gray-400 mt-4 border-t pt-3">
                  Last check: {field.id === "A" ? "2 hrs ago" : field.id === "B" ? "1 hr ago" : "30 mins ago"}
                </div>
              </div>
            ))}
          </div>

          {/* Sidebar */}
          <aside className="space-y-6">
            <div className="bg-white p-6 rounded-2xl shadow-sm border">
              <h4 className="font-semibold text-gray-800 mb-4">Farm Overview</h4>
              <div className="space-y-2 text-sm">
                <div className="flex justify-between"><span>Total Area</span><b>5 Acres</b></div>
                <div className="flex justify-between"><span>Region</span><b>Maharashtra</b></div>
                <div className="flex justify-between"><span>Soil Type</span><b>Black Soil</b></div>
                <div className="flex justify-between"><span>Irrigation</span><b>Canal + Borewell</b></div>
              </div>
            </div>

            <div className="bg-white p-6 rounded-2xl shadow-sm border text-center">
              <p className="text-xs font-bold text-gray-500 mb-2">Voice Input</p>
              <button className="w-full py-3 bg-green-600 rounded-xl text-white hover:bg-green-700 transition">
                Start Listening
              </button>
            </div>
          </aside>

        </main>
      </div>
    </div>
  );
};

export default MyFarm;
